import React from "react";
import { connect } from "react-redux";

const StreamList = () => {
  return <div>StreamList</div>;
};

const mapStateToProps = (state) => {
  return {
    streams: state.streams,
  };
};

export default connect(mapStateToProps, null)(StreamList);
